import React from "react";
import Navbar from "../Navbar";
import Footer from "../Footer";
import "./Home.css";
import Card from "../Card";
import Carousal from "../Carousal";

function Home() {
  return (
    <>
      <div>
        <Navbar />
      </div>
      <div>
        <Carousal />
      </div>
      <div className="m-3 d-inline">
        <Card />
        <Card />
        <Card />
        <Card />
        <Card />
        <Card />
        <Card />
      </div>
      <div>
        <Footer />
      </div>
    </>
  );
}

export default Home;
